    // Облако
    var attr = {
        fill: '#f1f1f3',
        //    stroke: '#000000',
        "stroke-width": 0,
        "stroke-linejoin": "round"
    };

    var attr_font = {
        'font-family': 'Arial',
        'font-size': 12
    };

    var cloud_str = "M 10.46875,0.5 C 4.9562404,0.5 0.5,4.9212402 0.5,10.40625 l 0,39.46875 c 0,5.48501 4.4562404,9.90625 9.96875,9.90625 l 11.4375,0 -4.96875,24.28125 22.28125,-24.28125 97.0625,0 c 5.51251,0 9.9375,-4.42124 9.9375,-9.90625 l 0,-39.46875 c 0,-5.4850098 -4.42499,-9.90625 -9.9375,-9.90625 l -125.8125,0 z";

    var clouds = {};
    var fo_names = {};

    for (r in sc_data) {
        clouds[r] = R.path(cloud_str).attr(attr);
        clouds[r].translate(coords['id' + sc_data[r][0]][0], coords['id' + sc_data[r][0]][1]);
        // +75,+30
        fo_names[r] = R.text(coords['id' + sc_data[r][0]][0] + 75, coords['id' + sc_data[r][0]][1] + 30, sc_data[r][1].replace(" ", "\n")).attr(attr_font);
    }

    for (r in sc_data) {
        clouds[r].hide();
    }

    for (r in sc_data) {
        fo_names[r].hide();
    }

    var flagSVG = 0;

    var current_fo = null;
    var selected_cloud = null;
    var current_cloud = null;

    function functionFix(region, selected_cloud) {
        for (r in sc_data) {
            if (region == r || selected_cloud == r) {
                svg_map[r].attr({ fill: active_fill, stroke: stroke });
                if (selected_cloud == r && region != r) { clouds[r].hide(); fo_names[r].hide(); }
            } else svg_map[r].attr({ fill: base_fill, stroke: stroke });
        }
    }

    for (var region in fo_names) {
        (function (cloud, region) {
            cloud[0].style.cursor = "pointer";
            cloud[0].onclick = function () {
                current_cloud = null;

                $('#YMapsID').hide();
                $('.fo_block').hide();
                $('.city_sc_list').hide();
                $('.region_block').hide();

                $('#fo_' + sc_data[region][0]).fadeIn('medium');

                for (r in sc_data) {
                    svg_map[r].attr({ fill: base_fill, stroke: stroke });
                }
                svg_map[region].attr({ fill: active_fill, stroke: stroke });

                current_fo = svg_map[region];
                selected_cloud = region;

                R.safari();
            };
            cloud[0].onmouseout = function () {
                current_cloud = null;
                flagSVG = 0;
            };
            cloud[0].onmouseover = function () {
                flagSVG = 1;
                functionFix(region, selected_cloud);
                current_cloud = cloud;
            };
        })(fo_names[region], region);
    }
    R.safari();


    for (var region in clouds) {
        (function (cloud, region) {
            cloud[0].style.cursor = "pointer";
            cloud[0].onclick = function () {
                current_cloud = null;

                $('#YMapsID').hide();
                $('.fo_block').hide();
                $('.city_sc_list').hide();
                $('.region_block').hide();

                $('#fo_' + sc_data[region][0]).fadeIn('medium');

                for (r in sc_data) {
                    svg_map[r].attr({ fill: base_fill, stroke: stroke });
                }
                svg_map[region].attr({ fill: active_fill, stroke: stroke });

                current_fo = svg_map[region];
                selected_cloud = region;

                R.safari();
            };


            cloud[0].onmouseout = function () {

                current_cloud = null;
                flagSVG = 0;

            };
            cloud[0].onmouseover = function () {
                flagSVG = 1;

                functionFix(region, selected_cloud);

                current_cloud = cloud;
            };
        })(clouds[region], region);
    }
    R.safari();

    var jk = null;
    var flagSVGO = null;

    for (var region in svg_map) {
        (function (st, region) {

            if (clouds[region]) {
                st[0].style.cursor = "pointer";

                st[0].onclick = function () {
                    current_cloud = null;

                    $('#YMapsID').hide();
                    $('.fo_block').hide();
                    $('.city_sc_list').hide();
                    $('.region_block').hide();

                    $('#fo_' + sc_data[region][0]).fadeIn('medium');

                    for (r in sc_data) {
                        svg_map[r].attr({ fill: base_fill, stroke: stroke });
                    }
                    st.attr({ fill: active_fill, stroke: stroke });

                    current_fo = st;
                    selected_cloud = region;

                    for (var cloud in clouds) {
                        if (cloud != selected_cloud) {
                            clouds[cloud].hide();
                            fo_names[cloud].hide();
                        }
                    }

                    R.safari();
                };


                st[0].onmouseover = function () {

                    if (flagSVGO != null) {

                        for (var cloud in clouds) {
                            if (cloud != selected_cloud) {
                                clouds[cloud].hide();
                                fo_names[cloud].hide();
                            }
                        }


                    }
                    flagSVGO = st;

                    st.attr({ fill: active_fill, stroke: stroke });
                    if (selected_cloud != null) {
                        if (region != selected_cloud) {
                            clouds[selected_cloud].hide();
                            fo_names[selected_cloud].hide();
                        }
                    }

                    clouds[region].show();
                    clouds[region].toFront();
                    fo_names[region].show();
                    fo_names[region].toFront();

                    R.safari();

                };

                st[0].onmouseout = function () {

                    st.attr({ fill: active_fill, stroke: stroke });

                    selected_cloud2 = selected_cloud;

                    if (selected_cloud != null) {

                        clouds[selected_cloud2].show();
                        fo_names[selected_cloud2].show();

                    }

                    selected_cloud = selected_cloud2;

                    for (r in sc_data) {
                        if (selected_cloud == r) svg_map[r].attr({ fill: active_fill, stroke: stroke }); else svg_map[r].attr({ fill: base_fill, stroke: stroke });
                    }

                    if (selected_cloud2 != "r" + (st.id + 1)) {
                        jk = setTimeout(function () {
                            if (flagSVG == 0) {
                                clouds["r" + (st.id + 1)].hide();
                                fo_names["r" + (st.id + 1)].hide();
                            }
                        }, 30);
                    }


                    R.safari();
                };
            }
        })(svg_map[region], region);
    }


