// Раскрыть город
function show_sc(id) {
    $('.active').removeClass('active');
    $('#YMapsID').hide();
    $('.city_sc_list').hide();
    $('#city_' + id).show();
    $("#" + $("#city_" + id).parent().attr("id") + " .city").removeClass().addClass("city");
    $('#sc_link_' + id).addClass('active');
}

function show_region(fo_id, id) {
    $('.active').removeClass('active');
    $('#YMapsID').hide();
    $('.city_sc_list').hide();
    $('.region_block').hide();
    $('#fo_' + fo_id + " .region").removeClass().addClass("region");
    $('#region_' + fo_id + '_' + id).show();
}

